const Stocks = () => {
  return (
    <div>

      <Grid container style={{border: '2px solid red'}}>

        {/* Search bar */}
        <Grid item md={8}>
          <Grid container margin={3} style={{
            backgroundColor:'white'
          }}>
            <TextField fullWidth placeholder='Search product data'/>
          </Grid>


        </Grid>

        {/* product list table */}
        <Grid item>

        </Grid>










      </Grid>




    </div>
  )
}

export default Stocks
